import Header from "./header";
import WeatherForm from "./weatherform";
import "./styles.css";

function App() {
  return (
    <div className="App">
      <Header />
      <WeatherForm />
      <h1>Weather App</h1>
      <footer>
        This project is coded by Alexa Cacchiola
        <a
          href="https://github.com/codergirlshecodes/React-App"
          target="_blank"
          rel="noopener noreferrer" 
        >
          open-sourced on Github
        </a>
      </footer>
    </div>
  );
}

export default App;
